    { url: "https://news.otakukart.com/wp-content/uploads/2020/01/Yajuza-7.jpg" },
    { url: "https://i0.wp.com/theplaystationbrahs.com/wp-content/uploads/2020/09/returnal-ps5.jpg?fit=1337%2C762&ssl=1" }
